(1, 1, 'Caminar', 'Caminar en terreno plano', 'Pierna', 'Fácil', 'Simplemente camina', 2, 1),
(2, 1, 'Correr', 'Correr en terreno plano a ritmo moderado', 'Pierna', 'Moderado', 'Corre a un ritmo constante durante al menos 30 minutos', 7, 1),
(3, 2, 'Flexiones', 'Flexiones de brazo en el suelo', 'Pecho', 'Moderado', 'Realiza flexiones manteniendo el cuerpo recto y bajando hasta que el pecho toque el suelo', 4, 1),
(4, 3, 'Abdominales', 'Abdominales tradicionales', 'Abdomen', 'Moderado', 'Realiza abdominales levantando el torso hacia las rodillas mientras mantienes los pies en el suelo', 3, 1),
(5, 3, 'sprint', 'correr muy pero que muy rapido', 'piernas', 'extrema', 'debes correra  maxima velocidad', 50, 1),
(6, 3, 'Abdominales en bicicleta', 'Los abdominales en bicicleta son un ejercicio que combina la flexión del tronco con la rotación, lo que ayuda a fortalecer el core y mejorar la estabilidad y la resistencia en la región abdominal.', 'Core', 'Intermedio', 'Acuéstate sobre una colchoneta con las manos detrás de la cabeza y las piernas elevadas, flexionadas en un ángulo de 90 grados. Inhala y, al exhalar, levanta la cabeza y los hombros del suelo mientras giras el torso hacia la derecha, llevando el codo izquierdo hacia la rodilla derecha. Alterna el movimiento, extendiendo la pierna izquierda y girando hacia la izquierda, llevando el codo derecho hacia la rodilla izquierda. Continúa alternando de esta manera durante 10-15 repeticiones por lado, asegurándote de mantener el abdomen contraído y el cuello relajado.', 5, 1),
(8, 3, 'Pruebaa', 'achu', 'todo', 'Principiante', 'prueba', 1, 1),
(9, 15, 'Trotar', 'Correr es un ejercicio aeróbico, muy bueno para el corazón. ', 'Todo el cuerpo, especialmente el tren inferior', 'Intermedio', 'Comienza trotando despacio y continua en un ritmo cómodo para ti. Inclina el torso ligeramente hacia delante. La técnica está, no en ampliar tu zancada estirando las rodillas, sino sentir que empujas el suelo con tus talones', 5, 1),
(10, 3, 'Natación', 'Nada', 'Cuerpo total', 'Avanzado', 'Nada mucho y muy rápido', 25, 0);

