INSERT INTO `recetas` (`id`, `nombre`, `descripcion`, `instrucciones`, `cantidad_final`, `proteinas`, `grasas`, `carbohidratos`, `azucares`, `vitaminas`, `calorias`, `imagen`, `id_usuario_id`, `estado`) VALUES
(1, 'Macarrones con tomate', 'Los macarrones con tomate de mi abuela que tanto me han gustado siempre', '- Cocer los macarrones al gusto\r\n- Echar el tomate a los macarrones\r\n\r\nOpcional\r\n- Echar salchichas\r\n- Echar queso rallado y gratinarlo 5 min', 1, 19.64, 12.96, 85.2, 7.98, 23.78, 5, 'data:image/webp;base64,', 2, 1);
INSERT INTO `recetas` (`id`, `nombre`, `descripcion`, `instrucciones`, `cantidad_final`, `proteinas`, `grasas`, `carbohidratos`, `azucares`, `vitaminas`, `calorias`, `imagen`, `id_usuario_id`, `estado`) VALUES
(2, 'Ensalada César', 'Ensalada clásica con pollo, lechuga, y aderezo César', '- Cortar la lechuga y el pollo en tiras\r\n- Mezclar la lechuga, el pollo, los croutones y el queso parmesano\r\n- Agregar el aderezo César y mezclar bien\r\n- Servir y disfrutar', 1, 21.6, 18.3, 11.2, 2.1, 17.4, 2, 'data:image/webp;base64,', 3, 1);
INSERT INTO `recetas` (`id`, `nombre`, `descripcion`, `instrucciones`, `cantidad_final`, `proteinas`, `grasas`, `carbohidratos`, `azucares`, `vitaminas`, `calorias`, `imagen`, `id_usuario_id`, `estado`) VALUES
(3, 'Pollo al curry', 'Pollo cocinado en una rica salsa de curry con vegetales', '- Cortar el pollo en trozos\r\n- Saltear la cebolla y el ajo\r\n- Agregar el pollo y cocinar hasta dorar\r\n- Añadir la leche de coco y el curry\r\n- Cocinar a fuego lento hasta que el pollo esté tierno\r\n- Servir con arroz', 1, 31.2, 15.4, 12.9, 5.4, 21.3, 35, 'data:image/webp;base64,', 2, 1);
INSERT INTO `recetas` (`id`, `nombre`, `descripcion`, `instrucciones`, `cantidad_final`, `proteinas`, `grasas`, `carbohidratos`, `azucares`, `vitaminas`, `calorias`, `imagen`, `id_usuario_id`, `estado`) VALUES
(4, 'Batido de frutas', 'Batido refrescante con una mezcla de frutas', '- Cortar las frutas en trozos\r\n- Añadir las frutas y el yogur en la licuadora\r\n- Licuar hasta obtener una mezcla homogénea\r\n- Servir frío', 1, 4.2, 1.1, 23.8, 18.6, 29.8, 21, 'data:image/webp;base64,', 2, 1);
INSERT INTO `recetas` (`id`, `nombre`, `descripcion`, `instrucciones`, `cantidad_final`, `proteinas`, `grasas`, `carbohidratos`, `azucares`, `vitaminas`, `calorias`, `imagen`, `id_usuario_id`, `estado`) VALUES
(5, 'Sopa de lentejas', 'Sopa nutritiva de lentejas con verduras', '- Remojar las lentejas durante la noche\r\n- Cocinar las lentejas con zanahoria, apio, y cebolla\r\n- Agregar especias al gusto\r\n- Cocinar a fuego lento hasta que las lentejas estén tiernas\r\n- Servir caliente', 1, 12.8, 3.7, 30.4, 4.5, 18.2, 12, 'data:image/webp;base64,', 3, 1);
